import React,{useState} from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
const Login=()=>{
    const[regd,SetRegd]=useState("");
    const[year,SetYear]=useState("");
    const[branch,Setbranch]=useState("");
    const Submit=async()=>{
        const res=await axios.post("http://localhost:8000/login/"+regd+"/"+year+"/"+branch);
        if(res)
        {
            alert("saved successfully")
        }
    }
    return(
        <>
        <table className="border" align="center">
        <tr rowSpan="10">
        <th>Register Number</th>
        <td colspan="10">
        <input className="inputwidth" type="text" id="regd" placeholder="Regd.no" name="regd" onChange={(e)=>SetRegd(e.target.value)}/></td></tr><br/>
        <tr rowSpan="10">
        <th>Year Of Studying</th>
        <td><input type="radio" id="1st"  name="year" onChange={(e)=>SetYear('1')}/><label for="1st">1st</label></td>
        <td><input type="radio" id="2nd"  name="year" onChange={(e)=>SetYear('2')}/><label for="1st">2nd</label></td>
       <td> <input type="radio" id="3rd"  name="year" onChange={(e)=>SetYear('3')}/><label for="1st">3rd</label></td>
        <td><input type="radio" id="4th"  name="year" onChange={(e)=>SetYear('4')}/><label for="1st">4th</label></td>
        </tr><br/>
        <tr rowSpan="10">
        <th>Branch</th>
        <td><select name="branch" id="branch" onChange={(e)=>Setbranch(e.target.value)}>
            <option value="AIDS">Artificial Intelligence And Data Science</option>
            <option value="AIML">Artificial Intelligence And Machine Learning</option>
            <option value="Civil">Civil</option>
            <option value="CSBS">Computer Science And Business System</option>
            <option value="CSD">Computer Science And Design</option>
            <option value="CSE">Computer Science</option>
            <option value="ECE">Electrical And Communication</option>
            <option value="EEE">Electrical And Electronics</option>
            <option value="MECH">Mechanical</option>
            </select></td>
        </tr><br/>
        <tr>
        <td colspan="5" align="center"><button className="buttonwidth" type="button" onClick={Submit}><b>Submit</b></button></td></tr>
        <br/>
        </table>
        </>
    )

}
export default Login;
